import React from 'react'
import './MyDate.css'

function MyDate(props) {
  const month = props.date.toLocaleString({ month: 'long' })
  return (
    <div className='date'>
      <div className='month'></div>
      <div className='day'>20</div>
    </div>
  )
}

export default MyDate
